import React from 'react';
import { 
    IntroContentWrapper
 } from './intro-content.style';
import { IntroContentProps } from './into-content.props'

export const IntroContent = ( {
    isMenuItem = false,
    children,
    ...restProps
}: IntroContentProps) => {
    return (
        <IntroContentWrapper isMenuItem={isMenuItem} {...restProps}>{children}</IntroContentWrapper>

    );
}
